@Mimi B Most people (including the companies that have dropped JD) seem to be acting as if SHE won the UK trial. The reports on it all seem to be referring to it as "JD's trial against AH in the UK," which I see as being REALLY misleading and flat out wrong. 

Basically the trial was to prove she lied (and she was caught in many lies) AND that The Sun KNEW they were lies at the time, which is really hard to prove without them admitting to it somewhere.

Honestly, even though The Sun won the case, they should probably publish a second article explaining how they were lied to and the first article is bullshit. A correction should be posted on the original article too, but corrections never get as much tracktion, which is why I think a new article is important. Also have a link to the new article in the correction on the original one. I think that's the least they could do for their own Journalistic integrity and responsibility.
